import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='container mx-auto'>
      <div className="navbar bg-base-100">
        <div className="navbar-start">
          <img src={logo} alt='logo' className='w-12 h-12'/>
        </div>
        <div className="navbar-center">
          <a href='/' className="normal-case text-xl font-extrabold italic">Feby Febri Y</a>
        </div>
        <div className="navbar-end">
          <ul className="menu menu-horizontal px-1">
            <li><a href='/' className='font-bold'>Project</a></li>
            <li><a href='/' className='font-bold'>Blog</a></li>
            <li><a href='/' className='font-bold'>Contact</a></li>
            <li><a href='/' className="btn">Get In Touch</a></li>
          </ul>
        </div>
      </div>
    </div>
    // Main Content
  );
}

export default App;
